Vision Wheel M4 ECSTAR Suzuki MotoAmerica Superbike Race Recap from Circuit of The Americas Fuel By @missionfoodsus. 

@escalanterichie earned a career first Superbike podium, finishing second in Race 1 on Saturday. He fell over while fighting with the lead group in Race 2 on Sunday, remounting to finish 16th.

Superbike rookie @brandon_paasch crashed out of a top-5 position in Race 1, but was able to recover and finish 5th on Sunday.

The Vision Wheel M4 ECSTAR Suzuki Superbike squad heads to NJMP to finish the season at the end of September. 

